// import React from 'react';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';

import kitty from '../images/orange_cat.png';
import AboutMe from './AboutMe';

export default function Navigation() {
    return (
        <>
            <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css"/>

            <Navbar className="navbar" class="navbar">
                <img src={kitty} className="kitty" alt="logo orange cat image"/>

                <Container className="github-container">
                    <i className="fa fa-github"></i>
                    <Nav.Link className="github-link" href="https://github.com/ilgharr">GitHub</Nav.Link>
                </Container>

                <div className="linkedin-container">
                    <i className="fa fa-linkedin-square"></i>
                    <Nav.Link href="https://www.linkedin.com/in/ilghar-rahno-5a40aa220/">Linkedin</Nav.Link>
                </div>

                <div className="about-me-container">
                    <AboutMe/>
                </div>

            </Navbar>
        </>


    )
}
